import React from "react";

const Newsletter = () => {
  return (
    <div className="text-white flex flex-col w-full py-24 px-10 text-left">
      <h1 className="text-3xl font-bold pb-2">
        Want tips & tricks to optimize
      </h1>
      <p>Sign up to our newsletter and styp up to date.</p>
      <input
        className="mt-10 p-2 rounded-md"
        placeholder="Enter Your Email"
        type={"email"}
      />
    </div>
  );
};

export default Newsletter;
